import styled from 'styled-components/native'

export const Container = styled.View`
  flex: 1;
  background-color: transparent;
  padding-top: 30;
  flex-direction: column;
  align-items: center;
`

export const Objective = styled.Text`
  font-size: 25;
  color: white;
  padding: 10px;
  font-weight: bold;
  text-align: center;
  height: 70;
  /* z-index:2; */
`

export const Hand = styled.Image`
  width: 200px;
  height: 300px;
  margin-top: 0px;
`
